INSERT INTO "fulltext_search" VALUES (1,'items','[Monastery]','[Monastery]',13,1),(1,'site_pages','Home','DIGITAL BIRGITTA is an open-access, multi-feature database of books and objects related to St. Birgitta of Sweden and Syon Abbey, that survive from medieval England. It integrates:\r\n\r\n\r\n	Database entries of books, works, people, and places &nbsp;provide a wealth of information about all traces of Birgitta in England before the Reformation.&nbsp;The database uses linked data, which means that entries connect to each other and thus facilitate exploration of all the connections between entries.\r\n	Network graphs visualize the relationship between these books, people, places, and institutions.\r\n	Digital editions offer new, accessible editions of specific Birgittine texts, while manuscript image viewers give an instant view in to specific manuscripts.\r\n\r\n\r\nBy searching in DIGITAL BIRGITTA you can discover new connections between texts, readers, and textual communities&nbsp;that help to show&nbsp;the full breadth of Birgitta&rsquo;s influence. &nbsp;\r\n\r\n&nbsp;\r\n\r\nSCOPE\r\n\r\nDIGITAL BIRGITTA includes:\r\n\r\n\r\n	\r\n	all the instances of the Revelations and related texts, in both Latin and Middle English, that originated in England or were known in medieval England\r\n	\r\n	\r\n	individually copied excerpts from the Revelations, in both Latin and Middle English\r\n	\r\n	\r\n	devotional compilations, in both Latin and Middle English, that borrow from the Revelations\r\n	\r\n	\r\n	any other sources, book objects or otherwise, that refer to Birgitta or show reception of her Revelations\r\n	\r\n	\r\n	many of the books owned by members (especially nuns) of Syon Abbey, the sole Birgittine house in England\r\n	\r\n\r\n\r\n\r\nWAYS TO USE DIGITAL BIRGITTA\r\n\r\nBROWSE\r\n\r\nTo browse the database entries, click on one of the menu items above: Books &amp; Manuscripts; Works; People; Places; Bibliography. These lead directly to full lists.\r\n\r\nNETWORKS\r\n\r\nTo generate network graphs from the database, click \r\n\r\nDIGITAL EDITIONS\r\n\r\nTo access a full list of all the editions, click on the menu item above: Editions.&nbsp;\r\n\r\nSEARCH\r\n\r\nTo search all entries enter a search term in the search box below. There is also an advanced search form located&nbsp;here.\r\n\r\nEXPORT\r\n\r\nAll the data in DIGITAL BIRGITTA is Open Access and free to download. Each entry contains export links at the bottom of the page. [directions for mass export?]\r\n\r\n',1,1),(2,'items','[Library]','[Library]\nA generic resource to be used as institution type',13,1),(2,'site_pages','People','',1,1),(3,'items','Lambeth Palace Library','Lambeth Palace Library\nLondon, UK\n[Library]',13,1),(3,'site_pages','Places','',1,1),(4,'items','Syon Abbey','Syon Abbey\nIsleworth, UK\n[Monastery]\n51,48\n-0,31',13,1),(4,'site_pages','Works','',1,1),(5,'items','Sheen Charterhouse','Sheen Charterhouse\nIsleworth, UK\n[Monastery]\n51,44\n-0,27',13,1),(5,'site_pages','Books & Manuscripts','',1,1),(6,'items','Archbishop Marsh\'s Library','Archbishop Marsh\'s Library\nDublin, Ireland\n[Library]\n53,34\n-6,27',13,1),(7,'items','Sidney Sussex Library (Cambridge)','Sidney Sussex Library (Cambridge)\nCambridge, UK\n[Library]',13,1),(8,'items','Trinity College Library (Cambridge)','Trinity College Library (Cambridge)\nCambridge, UK\n[Library]',13,1),(9,'items','Cambridge University Library','Cambridge University Library\nCambridge, UK\n[Library]',13,1),(10,'items','Glasgow University Library','Glasgow University Library\nGlasgow, UK\n[Library]',13,1),(10,'site_pages','New people','',1,1),(11,'items','Codrington Library','Codrington Library\nOxford, UK\n[Library]',13,1),(11,'site_pages','Modern institutions','',1,1),(12,'items','The Morgan Library and Museum','The Morgan Library and Museum\nNew York, USA\n[Library]',13,1),(12,'site_pages','Networks','Build your network\r\n\r\nInstructions about how to use the network viewer here.&nbsp;\r\n\r\n\r\n',