atin prayer (Benedictus sis tu domine mi deus meus et amor meus dilectissime.)\nLatin\n1',17,1),(378,'items','Latin prayer (Benedictus sis tu domine mi deus meus et amor meus dilectissime.) (Edinburgh, UL, MS 86)','Edinburgh, University Library, MS 86\nLatin prayer (Benedictus sis tu domine mi deus meus et amor meus dilectissime.)\nLatin prayer (Benedictus sis tu domine mi deus meus et amor meus dilectissime.) (Edinburgh, UL, MS 86)\n4\nVery clear and uniform, and the rubrics good, but no initials have been inserted by the original scribe.\nLatin\n1\nStarts on f. 306r with the following opening words: Hec oratio subscripte fuit a deo revelata beate Brigitte in qua pulchre et devote laudatur Christus cum narratione et de omnibus actibus et laboribus et doloribus vite et sanctissime mortis sue et de ascensione in celum et missione spiritus sancti in discipulos. Benedictus sis tu domine mi deus meus et amor meus dilectissime.\nParchment\n306r-307v?',17,1),(379,'items','Latin prayer (D. J. C. quamvis ego bene scio quod benedictum corpus.)','Latin prayer (D. J. C. quamvis ego bene scio quod benedictum corpus.)\nLatin\n1',17,1),(380,'items','Latin prayer (D. J. C. quamvis ego bene scio quod benedictum corpus.) (Edinburgh, UL, MS 86)','Edinburgh, University Library, MS 86\nLatin prayer (D. J. C. quamvis ego bene scio quod benedictum corpus.)\nLatin prayer (D. J. C. quamvis ego bene scio quod benedictum corpus.) (Edinburgh, UL, MS 86)\n5\nThe hand is very clear and uniform, and the rubrics good, but no initials have been inserted by the original scribe.\nLatin\n1\nStarts on f. 307v with the following opening words: In hac oratione a deo revelata beate Brigitte de pulchre laudantur omnia membra sanctissimi corporis D. N. J. C. et virtuosissimi ac ejus corporalis. D. J. C. quamvis ego bene scio quod benedictum corpus.\nParchment\n307v-308v?',17,1),(381,'items','Latin prayer (O Domina mea, vita mea, regina celi.)','Latin prayer (O Domina mea, vita mea, regina celi.)\nLatin\n1',17,1),(382,'items','Latin prayer (O Domina mea, vita mea, regina celi.) (Edinburgh, UL, 86)','Edinburgh, University Library, MS 86\nLatin prayer (O Domina mea, vita mea, regina celi.)\nLatin prayer (O Domina mea, vita mea, regina celi.) (Edinburgh, UL, 86)\n6\nThe hand is very clear and uniform, and the rubrics good, but no initials have been inserted by the original scribe.\nLatin\n1\nStarts on f. 308v with the following opening words: In ista oratione que divinitus fuit reveiata beate Brigitte devotissime et pulchre laudantur omnia membra gloriosi corporis virginis marie et virtuosi actus ejus corporalis. O Domina mea, vita mea, regina celi. Ends on f. 310r with the following words: et solamen habuerunt. Qui vivis et regnas deus per omnia sec. sec. Amen.\nParchment\n308v-310r',17,1),(383,'items','Hour-services for St. Bridget\'s day, with music noted','Hour-services for St. Bridget\'s day, with music noted\nLatin\n1',17,1),(384,'items','Alphonse of Pecha, 1327-1389','Alphonse of Pecha, 1327-1389\nAlfonso of JaÈn\nLatin\n0',17,1),(385,'items','Tractatus de summis pontificibus','Alphonse of Pecha, 1327-1389\nTractatus de summis pontificibus\nLatin\n1',17,1),(386,'items','Celeste uiridarium','Alphonse of Pecha, 1327-1389\nCeleste uiridarium\nLatin\n1\nA compilation of Birgitta\'s revelations concerning the Virgin Mary',17,1),(388,'items','Regula saluatoris (BL, Harley MS 612)','London, British Library, Harley MS 612\nPapal letters approving Regula sancta salvatoris and Constitutions for Vadstena\nRegula saluatoris (BL, Harley MS 612)\n5\nThomas Colyngbourn\nGothic cursive\n1425-1475\nLatin\n1\nThis is the basic rule for the order and this manuscrips preserves a copy of the II text (in prima persona). In this copy it is expanded by the addition of some of the reuelationes extrauagantes\nParchement',17,1),(389,'items','Defensoria eorundem per tres doctores','Defensoria eorundem per tres doctores\nLatin\n1',17,1),(390,'items','London, British Library,  Additional MS 37790','London, UK\nBritish Library\nDe emendatione vitae (BL, Add MS 37790)\nIncendium amoris (BL, Add MS 37790)\nThe Golden Epistle of Saint Bernard (BL, Add MS 37790)\nRevelations of Divine Love (BL, Add MS 37790)\nDe calculo candido (BL, Add MS 37790)\nExcerpts of Richard Rolle\'s works (BL, Add MS 37790)\nFormula compendiosa rite spiritualis (BL, Add MS 37790)\nThe myrroure of symple saules (BL, Add MS 37760)\nLatin compilation (Quedam introductiva ad contemplacionem extracta) (BL, Add MS 37790)\nVia ad contemplacionem (BL, Add MS 37790)\nExtract from Revelations (BL, Add MS 37790)\nLondon, British Library,  Additional MS 37790\n[Manuscript]\nThe Amherst Manuscript\nMid 15th century\nEngland\n1\nPezzini (1988)\nSee R. Stauffer, W. R. Terry, A Companion to Marguerite Porete and the Mirror of Simple Souls (2017) for more information on works included within the manuscript\nParchment\n265 x 175mm\n238\nii + 238\nhttp://www.bl.uk/manuscripts/FullDisplay.aspx?ref=Add_MS_37790 Online catalogue entry\nInitials in blue with pen-flourishing in red, or in red. Rubrics in red.',17,1),(391,'items','Richard Rolle of Hampole','Richard Rolle of Hampole\nHermit, mystic, religious writer',17,1),(392,'items','Richard Misyn, active 1435','Richard Misyn, active 1435\nRycharde Misyn\nCarmelite monk',17,1),(393,'items','De emendatione vitae','Richard Rolle of Hampole\nDe emendatione vitae\nLatin\n0',17,1),(394,'items','De emendatione vitae (BL, Add MS 37790)','London, British Library, MS Additional 37790\nDe emendatione vitae\nDe emendatione vitae (BL, Add MS 37790)\n1\nGothic cursive\nEnglish, Middle\n0\nTranslated into Middle English by the Carmelite monk, Richard Misyn. The rubric begins, \'This boke is off mendynge of lyfe or ellys off the rewle of lyfynge\'. The translator\'s name is given in the colophon: \'Thus endis the xii chapetyrs off Richarde Hampole into Englys translate be frere Rycharde Misyn to infformacioun off crystyn saulis anno domini millesimo ccccxxxiiii\' (1435)\n1r-18r',17,1),(395,'items','Incendium amoris','Richard Rolle of Hampole\nIncendium amoris\nLatin\n0',17,1),(396,'items','Incendium amoris (BL, Add MS 37790)','London, British Library, MS Additional 37790\nIncendium amoris\nIncendium amoris (BL, Add MS 37790)\n2\nGothic cursive\nEnglish, Middle\n0\nTranslated by Richard Mysin. The colophon states, \'Explicit liber de incendio amoris Ricardi Hampole heremite translatus in Anglicum instanciis domine Margarete Heslyngton recluse per fratrem Ricarduni Misyn sacre theologie bachalarium tunc priorem Lyncoln ordinis Carmelitarum anno domini mccccc xxxv (1435) in festo translacionis sancti Martini episcopi quod est iiii Nonas Julii per dictum fratrem Ricardum Misyn scriptum et correctum\';\nParchment\n18v-95r',17,1),(397,'items','The Golden Epistle of Saint Bernard','The Golden Epistle of Saint Bernard\nLatin\n0',17,1),(398,'items','The Golden Epistle of Saint Bernard (BL, Add MS 37790)','London, British Library, MS Additional 37790\nThe Golden Epistle of Saint Bernard\nThe Golden Epistle of Saint Bernard (BL, Add MS 37790)\n3\nGothic cursive\nEnglish, Middle\n0\nAn anonymous work wrongly attributed to Saint Bernard, translated into Middle English. The rubric states, \"This pistill made saynt Barnarde vnto his cosyn the whiche is calde a goldyn pystill: Wor the grete abundaunce of gostely ffruyt that is contynede in itt\'; at the end is the monogram, \'I.S.\'\nParchment\n95v-96v',17,1),(399,'items','Julian of Norwich','Julian of Norwich\nNun, mystic, hermit',17,1),(400,'items','Revelations of Divine Love','Julian of Norwich\nRevelations of Divine Love\nEnglish, Middle\n0',17,1),(401,'items','Revelations of Divine Love (BL, Add MS 37790)','London, British Library, MS Additional 37790\nRevelations of Divine Love\nRevelations of Divine Love (BL, Add MS 37790)\n4\nGothic cursive\nEnglish, Middle\n0\nIn the short version, with the rubric, \'Here es a vision schewed be the goodenes of god to a devoute woman and hir name es Julyan that is recluse atte Norwyche and zitt ys on lyfe anno domini millesimo ccccxiii\' (1413)\nParchment\n97r-115r',17,1),(402,'items','Jan van Ruusbroec, 1293?-1381','Jan van Ruusbroec, 1293?-1381\nAugustinian canon and Flemish mystic',17,1),(403,'items','De calculo candido','Jan van Ruusbroec, 1293?-1381\nDe calculo candido\nLatin\n0',17,1),(404,'items','De calculo candido (BL, Add MS 37790)','London, British Library, MS Additional 37790\nDe calculo candido\nDe calculo candido (BL, Add MS 37790)\n5\nGothic cursive\nEnglish, Middle\n0\n\'Vanden Blinckenden Steen\' (the Latin original is \'De calculo candido\'), translated into Middle English by Willem Jordaens, as \'A trettesse the whiche is called the trettesse of perfeccion off the Sonnys of God\', with the preface beginning, \'In the name of the blissed Trinite.....I intende to transpose for myne owne lernynge a trettese from Latyn into Englyseh compiled bi dan John Rusbroke\'\nParchment\n115r-130r',17,1),(405,'items','Willem Jordaens, ca. 1321-1372','Willem Jordaens, ca. 1321-1372\nFlemic mystic\nTranslated several of Jan van Russbroeks\'s works',17,1),(406,'items','Excerpts of Richard Rolle\'s works (BL, Add MS 37790)','London, British Library, MS Additional 37790\nExcerpts of Richard Rolle\'s works (BL, Add MS 37790)\n6\nGothic cursive\nLatin\n0\nExcerpts from \'Forma vivendi \'and \'Ego dormio\' with the rubrics, \'De triplici genere amoris spiritualis\' and \'Tractatus de diligendo deo\'\nParchment\n130v-135v',17,1),(407,'items','Horologium Sapientiae','Henry Suso, 1295?-1366\nHorologium Sapientiae\nLatin\n0',17,1),(408,'items','Formula compendiosa rite spiritualis (BL, Add MS 37790)','London, British Library, MS Additional 37790\nHorologium Sapientiae\nFormula compendiosa rite spiritualis (BL, Add MS 37790)\n7\nGothic cursive\nEnglish\n0\n\'Formula compendiosa rite spiritualis\', part of the English abridged version of the \'Horologium Sapientiae\'\nParchment\nf. 135v-136v',17,1),(409,'items','Marguerite Pore?te 1250-1310','Marguerite Pore?te 1250-1310\nFrench mystic',17,1),(410,'items','Miroer des Simples Ames','Marguerite Pore?te 1250-1310\nMiroer des Simples Ames\nFrench\n0',17,1),(411,'items','The myrroure of symple saules (BL, Add MS 37760)','London, British Library, MS Additional 37790\nMiroer des Simples Ames\nThe myrroure of symple saules (BL, Add MS 37760)\n8\nGothic cursive\nEnglish, Middle\n0\n\'The myrroure of symple saules\' a Middle English translation of Marguerite PorËte, \'Miroer des Simples Ames\'; the text concludes with a songe which begins and ends \'Therfore his ize behaldes me; th[a]t he loves noon mare than me\', The verse colophon is, \'Here endeth the Boke that Love calles the myrroure of Symple Saules. Who that this booke wille undirstande Take t[ha]t lorde to his spouse lovande That is god in Trinite. Iesu mercy and grace Marie praye for us. En dieu desormes. M.P.\', followed by a prayer to the Trinity ending \'magnifie everlastingly withouten ende. Amen. Jesu merci. Amen.\'\nParchment\nff. 137r-225r',17,1),(412,'items','Latin compilation (Quedam introductiva ad contemplacionem extracta) (BL, Add MS 37790)','London, British Library,  Additional MS 37790\nSermones in canticum canticorum\nSermones in ascensioni Domini\nProslogion\nLiber soliloquioum animae ad Deum\nLatin compilation (Quedam introductiva ad contemplacionem extracta) (BL, Add MS 37790)\n9\nGothic cursive\nLatin\n0\nA Latin compilation, titled, \'Quedam introductiva ad contemplacionem extracta ex diversis deuvtis tractatibuset precipue ex libro soliloquiorum beati Augustini episcopi. Capitulum quadragesimum octavum\', including fragments from Pseudo-Augustine, Anselm of Canterbury and Bernard of Clairvaux\nParchment\nff. 226r-233v',17,1),(413,'items','Via ad contemplacionem (BL, Add MS 37790)','London, British Library, MS Additional 37790\nVia ad contemplacionem (BL, Add MS 37790)\n10\nGothic cursive\nEnglish, Middle\n0\n\'Via ad contemplacionem\', an extract in Middle English on three ways of contemplation (purgative, illuminative and unitive), based on parts of \'The Cloud of Unknowing\' and related texts; A short text on contemplation, beginning, \'Labure hastely for the tyme is schorte\' and ending \'more compassioun of a synnere than a synnere can have of hym selfe\'\nParchment\nff. 234r-236r',17,1),(414,'items','Extract from Revelations (BL, Add MS 37790)','London, British Library, MS Additional 37790\nExtract from Revelations (BL, Add MS 37790)\n11\nGothic cursive\nEnglish, Middle\n1\n2.16\nSt. Bridget of Sweden, \'Revelationes\', 2.16, translated into Middle English, imperfect at the end as f. 237 is mostly lacking.\nParchment\n236v-237r',17,1),(415,'items','Translation of \"De emendatione vitae\" by Richard Mysin into Middle English','De emendatione vitae (BL, Add MS 37790)\nTranslation of \"De emendatione vitae\" by Richard Mysin into Middle English\n[Excerpt]\n1\nRichard Misyn, active 1435\nTranslator',17,1),(416,'items','Translation of \'Incendium amoris\' by Richard Mysin','Incendium amoris (BL, Add MS 37790)\nTranslation of \'Incendium amoris\' by Richard Mysin\n[Excerpt]\n1\nRichard Misyn, active 1435\nTranslator',17,1),(417,'items','Translation of \'De calculo candido\' by Willem Jordaens into Middle English','De calculo candido (BL, Add MS 37790)\nTranslation of \'De calculo candido\' by Willem Jordaens into Middle English\n[Excerpt]\n1\nWillem Jordaens, ca. 1321-1372\nTranslator',17,1),(418,'items','Henry Suso, 1295?-1366','Henry Suso, 1295?-1366\nAmandus\nDominican friar, vernacular writer\nHenry Suso',17,1),(419,'items','saint Bernard de Clairvaux, 1090?-1153','saint Bernard de Clairvaux, 1090?-1153\nSaint Bernard\nBurgundian abbot',17,1),(420,'items','Sermones in canticum canticorum','saint Bernard de Clairvaux, 1090?-1153\nSermones in canticum canticorum\nLatin\n0',17,1),(421,'items','Sermones in ascensioni Domini','saint Bernard de Clairvaux, 1090?-1153\nSermones in ascensioni Domini\nLatin\n0',17,1),(422,'items','Ans