ugh (Bodleian, MS Bodley 131)',17,1),(451,'items','John Wyndhyll','John Wyndhyll\nSon of Agnes Wyndhall\nLetter of confraternity to Agnes Wyndhyll, John her son and Robert... , from William, prior of Scarborough (Bodleian, MS Bodley 131)',17,1),(452,'items','Gradual (fragment, leaves marked xxix, xxx) (Bodleian, MS Bodley 131)','Oxford, Bodleian Library, MS. Bodley 131\nGradual (fragment, leaves marked xxix, xxx) (Bodleian, MS Bodley 131)\n0\n1150-1175\nLatin\nInitial\n0\nIncludes musical notation\nParchment\nff. i-ii',17,1),(453,'items','Robert ...','Robert ...\nLetter of confraternity to Agnes Wyndhyll, John her son and Robert... , from William, prior of Scarborough (Bodleian, MS Bodley 131)',17,1),(454,'items','London, British Library, Arundel MS 197','London, UK\nBritish Library\nThe Stathel of Sin (BL, Arundel MS 197)\nThe Meditation of St Anselm (BL, Arundel MS 197)\nTreatise on the nine virtues (BL, Arundel MS 197)\nThe Meditation of the Three Arrows (Bl, Arundel MS 197)\nA ˛ou sely sowle (BL, Arundel MS 197)\nContemplations of the Dread and Love of God (BL, Arundel MS 197)\nExtracts from Revelations (BL, Arundel MS 197)\nA treatise on the Sacrament (BL, Arundel MS 197)\nFormula Noviciorum (BL, Arundel MS 197)\nMeditations on Reliquie cogitacionis and Te deum laudamus (BL, Arundel MS 197)\nMeditation on Da nobis auxilium de tribulacion (BL, Arundel MS 197)\nLondon, British Library, Arundel MS 197\n[Manuscript]\n1450-75\n1\nAyto and Barratt (1984)\nConnolly (1994)\nPezzini (1988)\nConnolly (1994): The first five items, none of which is complete, form a collection of meditative material which is given the general heading \'Fervor Amoris\'. This heading is used elsewhere as a title for the text more familiarly known as Contemplations ofthe Dread and Love of God, the seventh item in Arundel 197.* The appearance of this heading at the top off. 1r is interesting, and must be either a mistake on the part of the scribe, or, as seems more likely, given the sequence and nature of these short texts, evidence of an attempt to compose a new work altogether, possibly re-writing Contemplations in the process. Redrafting is a characteristic of the manuscript as a whole. What is curious about this otherwise unremarkable collection of devotional pieces is that the text of each work has been subjected to extensive revision, with lengthy additions and omissions, and many corrections to individual words and phrases. The result is that the texts within Arundel 197 differ significantly from their other witnesses elsewhere.\nParchment\n192 x 132 mm\n73\nhttps://www.bl.uk/eblj/1994articles/pdf/article4.pdf Connolly (1994) - manuscript description\nVery plain, without decoration',17,1),(455,'items','The Stathel of Sin (BL, Arundel MS 197)','London, British Library, Arundel MS 197\nThe Stathel of Sin\nThe Stathel of Sin (BL, Arundel MS 197)\n1\nEnglish, Middle\n0\nWith chapter AB of Contemplations of the Dread and Love of God interpolated on ff. 1v-3r\nff. 1r-3v',17,1),(456,'items','The Stathel of Sin','The Stathel of Sin\nEnglish, Middle\n0',17,1),(457,'items','The Meditation of St Anselm','The Meditation of St Anselm\nEnglish, Middle\n0',17,1),(458,'items','The Meditation of St Anselm (BL, Arundel MS 197)','London, British Library, Arundel MS 197\nThe Meditation of St Anselm\nThe Meditation of St Anselm (BL, Arundel MS 197)\n2\nEnglish, Middle\n0\nAyto and Barratt (1984):  Translation of St. Anselm\'s Meditations I, \"Terret me vita mea\"; but in a private communication Dr Jolliffe says this is a partial version, followed by different meditational matter on ff. 5-6v.\nff. 3v-6v',17,1),(459,'items','Treatise on the nine virtues (BL, Arundel MS 197)','London, British Library, Arundel MS 197\nTreatise on the nine virtues (BL, Arundel MS 197)\n3\nEnglish, Middle\n0\nff. 6v-7r',17,1),(460,'items','The Meditation of the Three Arrows','The Meditation of the Three Arrows\nEnglish, Middle\n0',17,1),(461,'items','The Meditation of the Three Arrows (Bl, A