INSERT INTO "property" VALUES (1,NULL,1,'title','Title','A name given to the resource.'),(2,NULL,1,'creator','Creator','An entity primarily responsible for making the resource.'),(3,NULL,1,'subject','Subject','The topic of the resource.'),(4,NULL,1,'description','Description','An account of the resource.'),(5,NULL,1,'publisher','Publisher','An entity responsible for making the resource available.'),(6,NULL,1,'contributor','Contributor','An entity responsible for making contributions to the resource.'),(7,NULL,1,'date','Date','A point or period of time associated with an event in the lifecycle of the resource.'),(8,NULL,1,'type','Type','The nature or genre of the resource.'),(9,NULL,1,'format','Format','The file format, physical medium, or dimensions of the resource.'),(10,NULL,1,'identifier','Identifier','An unambiguous reference to the resource within a given context.'),(11,NULL,1,'source','Source','A related resource from which the described resource is derived.'),(12,NULL,1,'language','Language','A language of the resource.'),(13,NULL,1,'relation','Relation','A related resource.'),(14,NULL,1,'coverage','Coverage','The spatial or temporal topic of the resource, the spatial applicability of the resource, or the jurisdiction under which the resource is relevant.'),(15,NULL,1,'rights','Rights','Information about rights held in and over the resource.'),(16,NULL,1,'audience','Audience','A class of entity for whom the resource is intended or useful.'),(17,NULL,1,'alternative','Alternative Title','An alternative name for the resource.'),(18,NULL,1,'tableOfContents','Table Of Contents','A list of subunits of the resource.'),(19,NULL,1,'abstract','Abstract','A summary of the resource.'),(20,NULL,1,'created','Date Created','Date of creation of the resource.'),(21,NULL,1,'valid','Date Valid','Date (often a range) of validity of a resource.'),(22,NULL,1,'available','Date Available','Date (often a range) that the resource became or will become available.'),(23,NULL,1,'issued','Date Issued','Date of formal issuance (e.g., publication) of the resource.'),(24,NULL,1,'modified','Date Modified','Date on which the resource was changed.'),(25,NULL,1,'extent','Extent','The size or duration of the resource.'),(26,NULL,1,'medium','Medium','The material or physical carrier of the resource.'),(27,NULL,1,'isVersionOf','Is Version Of','A related resource of which the described resource is a version, edition, or adaptation.'),(28,NULL,1,'hasVersion','Has Version','A related resource that is a version, edition, or adaptation of the described resource.'),(29,NULL,1,'isReplacedBy','Is Replaced By','A related resource that supplants, displaces, or supersedes the described resource.'),(30,NULL,1,'replaces','Replaces','A related resource that is supplanted, displaced, or superseded by the described resource.'),(31,NULL,1,'isRequiredBy','Is Required By','A related resource that requires the described resource to support its function, delivery, or coherence.'),(32,NULL,1,'requires','Requires','A related resource that is required by the described resource to support its function, delivery, or coherence.'),(33,NULL,1,'isPartOf','Is Part Of','A related resource in which the described resource is physically or logically included.'),(34,NULL,1,'hasPart','Has Part','A related resource that is included either physically or logically in the described resource.'),(35,NULL,1,'isReferencedBy','Is Referenced By','A related resource that references, cites, or otherwise points to the described resource.'),(36,NULL,1,'references','References','A related resource that is referenced, cited, or otherwise pointed to by the described resource.'),(37,NULL,1,'isFormatOf','Is Format Of','A related resource that is substantially the same as the described resource, but in another format.'),(38,NULL,1,'hasFormat','Has Format','A related resource that is substantially the same as the pre-existing described resource, but in another format.'),(39,NULL,1,'conformsTo','Conforms To','An established standard to which the described resource conforms.'),(40,NULL,1,'spatial','Spatial Coverage','Spatial characteristics of the resource.'),(41,NULL,1,'temporal','Temporal Coverage','Temporal characteristics of the resource.'),(42,NULL,1,'mediator','Mediator','An entity that mediates access to the resource and for whom the resource is intended or useful.'),(43,NULL,1,'dateAccepted','Date Accepted','Date of acceptance of the resource.'),(44,NULL,1,'dateCopyrighted','Date Copyrighted','Date of copyright.'),(45,NULL,1,'dateSubmitted','Date Submitted','Date of submission of the resource.'),(46,NULL,1,'educationLevel','Audience Education Level','A class of entity, defined in terms of progression through an educational or training context, for which the described resource is intended.'),(47,NULL,1,'accessRights','Access Rights','Information about who can access the resource or an indication of its security status.'),(48,NULL,1,'bibliographicCitation','Bibliographic Citation','A bibliographic reference for the resource.'),(49,NULL,1,'license','License','A legal document giving official permission to do something with the resource.'),(50,NULL,1,'rightsHolder','Rights Holder','A person or organization owning or managing rights over the resource.'),(51,NULL,1,'provenance','Provenance','A statement of any changes in ownership and custody of the resource since its creation that are significant for its authenticity, integrity, and interpretation.'),(52,NULL,1,'instructionalMethod','Instructional Method','A process, used to engender knowledge, attitudes and skills, that the described resource is designed to support.'),(53,NULL,1,'accrualMethod','Accrual Method','The method by which items are added to a collection.'),(54,NULL,1,'accrualPeriodicity','Accrual Periodicity','The frequency with which items are added to a collection.'),(55,NULL,1,'accrualPolicy','Accrual Policy','The policy governing the addition of items to a collection.'),(800,14,11,'incentives','incentives','Description of bonus and commission compensation aspects of the job.'),(801,14,11,'byArtist','byArtist','The artist that performed this album or recording.'),(802,14,11,'children','children','A child of the person.'),(803,14,11,'valueMinLength','valueMinLength','Specifies the minimum allowed range for number of characters in a literal value.'),(804,14,11,'pickupLocation','pickupLocation','Where a taxi will pick up a passenger or a rental car can be picked up.'),(805,14,11,'vehicleInteriorType','vehicleInteriorType','The type or material of the interior of the vehicle (e.g. synthetic fabric, leather, wood, etc.). While most interior types are characterized by the material used, an interior type can also be based on vehicle usage or target audience.'),(806,14,11,'artMedium','artMedium','The material used. (e.g. Oil, Watercolour, Acrylic, Linoprint, Marble, Cyanotype, Digital, Lithograph, DryPoint, Intaglio, Pastel, Woodcut, Pencil, Mixed Media, etc.)'),(807,14,11,'accountId','accountId','The identifier for the account the payment will be applied to.'),(808,14,11,'attendees','attendees','A person attending the event.'),(809,14,11,'experienceRequirements','experienceRequirements','Description of skills and experience needed for the position or Occupation.'),(810,14,11,'membershipNumber','membershipNumber','A unique identifier for the membership.'),(811,14,11,'skills','skills','A statement of knowledge, skill, ability, task or any other assertion expressing a competency that is desired or required to fulfill this role or to work in this occupation.'),(812,14,11,'steeringPosition','steeringPosition','The position of the steering wheel or similar device (mostly for cars).'),(813,14,11,'proteinContent','proteinContent','The number of grams of protein.'),(814,14,11,'startDate','startDate','The start date and time of the item (in <a href=\"http://en.wikipedia.org/wiki/ISO_8601\">ISO 8601 date format</a>).'),(815,14,11,'arrivalStation','arrivalStation','The station where the train trip ends.'),(816,14,11,'serviceOperator','serviceOperator','The operating organization, if different from the provider.  This enables the representation of services that are provided by an organization, but operated by another organization like a subcontractor.'),(817,14,11,'geoDisjoint','geoDisjoint','Represents spatial relations in which two geometries (or the places they represent) are topologically disjoint: they have no point in common. They form a set of disconnected geometries.\" (a symmetric relationship, as defined in <a href=\"https://en.wikipedia.org/wiki/DE-9IM\">DE-9IM</a>)'),(818,14,11,'blogPosts','blogPosts','The postings that are part of this blog.'),(819,14,11,'validThrough','validThrough','The date after when the item is not valid. For example the end of an offer, salary period, or a period of opening hours.'),(820,14,11,'error','error','For failed actions, more information on the cause of the failure.'),(821,14,11,'estimatedSalary','estimatedSalary','An estimated salary for a job posting or occupation, based on a variety of variables including, but not limited to industry, job title, and location. Estimated salaries  are often computed by outside organizations rather than the hiring organization, who may not have committed to the estimated value.'),(822,14,11,'validFrom','validFrom','The date when the item becomes valid.'),(823,14,11,'currenciesAccepted','currenciesAccepted','The currency accepted.<br/><br/>\n\nUse standard formats: <a href=\"http://en.wikipedia.org/wiki/ISO_4217\">ISO 4217 currency format</a> e.g. \"USD\"; <a href=\"https://en.wikipedia.org/wiki/List_of_cryptocurrencies\">Ticker symbol</a> for cryptocurrencies e.g. \"BTC\"; well known names for <a href=\"https://en.wikipedia.org/wiki/Local_exchange_trading_system\">Local Exchange Tradings Systems</a> (LETS) and other currency types e.g. \"Ithaca HOUR\".'),(824,14,11,'thumbnailUrl','thumbnailUrl','A thumbnail image relevant to the Thing.'),(825,14,11,'closes','closes','The closing hour of the place or service on the given day(s) of the week.'),(826,14,11,'parent','parent','A parent of this person.'),(827,14,11,'taxID','taxID','The Tax / Fiscal ID of the organization or person, e.g. the TIN in the US or the CIF/NIF in Spain.'),(828,14,11,'addressCountry','addressCountry','The country. For example, USA. You can also provide the two-letter <a href=\"http://en.wikipedia.org/wiki/ISO_3166-1\">ISO 3166-1 alpha-2 country code</a>.'),(829,14,11,'employee','employee','Someone working for this organization.'),(830,14,11,'productionCompany','productionCompany','The production company or studio responsible for the item e.g. series, video game, episode etc.'),(831,14,11,'geographicArea','geographicArea','The geographic area associated with the audience.'),(832,14,11,'gameServer','gameServer','The server on which  it is possible to play the game.'),(833,14,11,'touristType','touristType','Attraction suitable for type(s) of tourist. eg. Children, visitors from a particular country, etc.'),(834,14,11,'accessibilityAPI','accessibilityAPI','Indicates that the resource is compatible with the referenced accessibility API (<a href=\"http://www.w3.org/wiki/WebSchemas/Accessibility\">WebSchemas wiki lists possible values</a>).'),(835,14,11,'containedInPlace','containedInPlace','The basic containment relation between a place and one that contains it.'),(836,14,11,'broadcastFrequencyValue','broadcastFrequencyValue','The frequency in MHz for a particular broadcast.'),(837,14,11,'busName','busName','The name of the bus (e.g. Bolt Express).'),(838,14,11,'predecessorOf','predecessorOf','A pointer from a previous, often discontinued variant of the product to its newer variant.'),(839,14,11,'actors','actors','An actor, e.g. in tv, radio, movie, video games etc. Actors can be associated with individual items or with a series, episode, clip.'),(840,14,11,'characterName','characterName','The name of a character played in some acting or performing role, i.e. in a PerformanceRole.'),(841,14,11,'valueReference','valueReference','A pointer to a secondary value that provides additional information on the original value, e.g. a reference temperature.'),(842,14,11,'countriesSupported','countriesSupported','Countries for which the application is supported. You can also provide the two-letter ISO 3166-1 alpha-2 country code.'),(843,14,11,'ratingValue','ratingValue','The rating for the content.<br/><br/>\n\nUsage guidelines:<br/><br/>\n\n<ul>\n<li>Use values from 0123456789 (Unicode \'DIGIT ZERO\' (U+0030) to \'DIGIT NINE\' (U+0039)) rather than superficially similiar Unicode symbols.</li>\n<li>Use \'.\' (Unicode \'FULL STOP\' (U+002E)) rather than \',\' to indicate a decimal point. Avoid using these symbols as a readability separator.</li>\n</ul>\n'),(844,14,11,'postOfficeBoxNumber','postOfficeBoxNumber','The post office box number for PO box addresses.'),(845,14,11,'hasBroadcastChannel','hasBroadcastChannel','A broadcast channel of a broadcast service.'),(846,14,11,'openingHours','openingHours','The general opening hours for a business. Opening hours can be specified as a weekly time range, starting with days, then times per day. Multiple days can be listed with commas \',\' separating each day. Day or time ranges are specified using a hyphen \'-\'.<br/><br/>\n\n<ul>\n<li>Days are specified using the following two-letter combinations: <code>Mo</code>, <code>Tu</code>, <code>We</code>, <code>Th</code>, <code>Fr</code>, <code>Sa</code>, <code>Su</code>.</li>\n<li>Times are specified using 24:00 time. For example, 3pm is specified as <code>15:00</code>. </li>\n<li>Here is an example: <code>&lt;time itemprop=\"openingHours\" datetime=&quot;Tu,Th 16:00-20:00&quot;&gt;Tuesdays and Thursdays 4-8pm&lt;/time&gt;</code>.</li>\n<li>If a business is open 7 days a week, then it can be specified as <code>&lt;time itemprop=&quot;openingHours&quot; datetime=&quot;Mo-Su&quot;&gt;Monday through Sunday, all day&lt;/time&gt;</code>.</li>\n</ul>\n'),(847,14,11,'seatNumber','seatNumber','The location of the reserved seat (e.g., 27).'),(848,14,11,'calories','calories','The number of calories.'),(849,14,11,'review','review','A review of the item.'),(850,14,11,'awards','awards','Awards won by or for this item.'),(851,14,11,'branchOf','branchOf','The larger organization that this local business is a branch of, if any. Not to be confused with (anatomical)<a class=\"localLink\" href=\"http://schema.org/branch\">branch</a>.'),(852,14,11,'gameTip','gameTip','Links to tips, tactics, etc.'),(853,14,11,'annualPercentageRate','annualPercentageRate','The annual rate that is charged for borrowing (or made by investing), expressed as a single percentage number that represents the actual yearly cost of funds over the term of a loan. This includes any fees or additional costs associated with the transaction.'),(854,14,11,'deathDate','deathDate','Date of death.'),(855,14,11,'translator','translator','Organization or person who adapts a creative work to different languages, regional differences and technical requirements of a target market, or that translates during some event.'),(856,14,11,'availabilityStarts','availabilityStarts','The beginning of the availability of the product or service included in the offer.'),(857,14,11,'foodEstablishment','foodEstablishment','A sub property of location. The specific food establishment where the action occurred.'),(858,14,11,'gamePlatform','gamePlatform','The electronic systems used to play <a href=\"http://en.wikipedia.org/wiki/Category:Video_game_platforms\">video games</a>.'),(859,14,11,'coursePrerequisites','coursePrerequisites','Requirements for taking the Course. May be completion of another <a class=\"localLink\" href=\"http://schema.org/Course\">Course</a> or a textual description like \"permission of instructor\". Requirements may be a pre-requisite competency, referenced using <a class=\"localLink\" href=\"http://schema.org/AlignmentObject\">AlignmentObject</a>.'),(860,14,11,'acceptedPaymentMethod','acceptedPaymentMethod','The payment method(s) accepted by seller for this offer.'),(861,14,11,'brand','brand','The brand(s) associated with a product or service, or the brand(s) maintained by an organization or business person.'),(862,14,11,'musicalKey','musicalKey','The key, mode, or scale this composition uses.'),(863,14,11,'members','members','A member of this organization.'),(864,14,11,'firstPerformance','firstPerformance','The date and place the work was first performed.'),(865,14,11,'lender','lender','A sub property of participant. The person that lends the object being borrowed.'),(866,14,11,'specialOpeningHoursSpecification','specialOpeningHoursSpecification','The special opening hours of a certain place.<br/><br/>\n\nUse this to explicitly override general opening hours brought in scope by <a class=\"localLink\" href=\"http://schema.org/openingHoursSpecification\">openingHoursSpecification</a> or <a class=\"localLink\" href=\"http://schema.org/openingHours\">openingHours</a>.'),(867,14,11,'numberOfForwardGears','numberOfForwardGears','The total number of forward gears available for the transmission system of the vehicle.<br/><br/>\n\nTypical unit code(s): C62'),(868,14,11,'geoIntersects','geoIntersects','Represents spatial relations in which two geometries (or the places they represent) have at least one point in common. As defined in <a href=\"https://en.wikipedia.org/wiki/DE-9IM\">DE-9IM</a>.'),(869,14,11,'lesserOrEqual','lesserOrEqual','This ordering relation for qualitative values indicates that the subject is lesser than or equal to the object.'),(870,14,11,'requiredQuantity','requiredQuantity','The required quantity of the item(s).'),(871,14,11,'free','free','A flag to signal that the item, event, or place is accessible for free.'),(872,14,11,'recipeYield','recipeYield','The quantity produced by the recipe (for example, number of people served, number of servings, etc).'),(873,14,11,'disambiguatingDescription','disambiguatingDescription','A sub property of description. A short description of the item used to disambiguate from other, similar items. Information from other properties (in particular, name) may be necessary for the description to be useful for disambiguation.'),(874,14,11,'ingredients','ingredients','A single ingredient used in the recipe, e.g. sugar, flour or garlic.'),(875,14,11,'arrivalAirport','arrivalAirport','The airport where the flight terminates.'),(876,14,11,'knows','knows','The most generic bi-directional social/work relation.'),(877,14,11,'width','width','The width of the item.'),(878,14,11,'contactPoint','contactPoint','A contact point for a person or organization.'),(879,14,11,'encodingFormat','encodingFormat','Media type typically expressed using a MIME format (see <a href=\"http://www.iana.org/assignments/media-types/media-types.xhtml\">IANA site</a> and <a href=\"https://developer.mozilla.org/en-US/docs/Web/HTTP/Basics_of_HTTP/MIME_types\">MDN reference</a>) e.g. application/zip for a SoftwareApplication binary, audio/mpeg for .mp3 etc.).<br/><br/>\n\nIn cases where a <a class=\"localLink\" href=\"http://schema.org/CreativeWork\">CreativeWork</a> has several media type representations, <a class=\"localLink\" href=\"http://schema.org/encoding\">encoding</a> can be used to indicate each <a class=\"localLink\" href=\"http://schema.org/MediaObject\">MediaObject</a> alongside particular <a class=\"localLink\" href=\"http://schema.org/encodingFormat\">encodingFormat</a> information.<br/><br/>\n\nUnregistered or niche encoding and file formats can be indicated instead via the most appropriate URL, e.g. defining Web page or a Wikipedia/Wikidata entry.'),(880,14,11,'dateVehicleFirstRegistered','dateVehicleFirstRegistered','The date of the first registration of the vehicle with the respective public authorities.'),(881,14,11,'serverStatus','serverStatus','Status of a game server.'),(882,14,11,'trainNumber','trainNumber','The unique identifier for the train.'),(883,14,11,'dateCreated','dateCreated','The date on which the CreativeWork was created or the item was added to a DataFeed.'),(884,14,11,'isBasedOnUrl','isBasedOnUrl','A resource that was used in the creation of this resource. This term can be repeated for multiple sources. For example, http://example.com/great-multiplication-intro.html.'),(885,14,11,'organizer','organizer','An organizer of an Event.'),(886,14,11,'author','author','The author of this content or rating. Please note that author is special in that HTML 5 provides a special mechanism for indicating authorship via the rel tag. That is equivalent to this and may be used interchangeably.'),(887,14,11,'orderedItem','orderedItem','The item ordered.'),(888,14,11,'speakable','speakable','Indicates sections of a Web page that are particularly \'speakable\' in the sense of being highlighted as being especially appropriate for text-to-speech conversion. Other sections of a page may also be usefully spoken in particular circumstances; the \'speakable\' property serves to indicate the parts most likely to be generally useful for speech.<br/><br/>\n\nThe <em>speakable</em> property can be repeated an arbitrary number of times, with three kinds of possible \'content-locator\' values:<br/><br/>\n\n1.) <em>id-value</em> URL references - uses <em>id-value</em> of an element in the page being annotated. The simplest use of <em>speakable</em> has (potentially relative) URL values, referencing identified sections of the document concerned.<br/><br/>\n\n2.) CSS Selectors - addresses content in the annotated page, eg. via class attribute. Use the <a class=\"localLink\" href=\"http://schema.org/cssSelector\">cssSelector</a> property.<br/><br/>\n\n3.)  XPaths - addresses content via XPaths (assuming an XML view of the content). Use the <a class=\"localLink\" href=\"http://schema.org/xpath\">xpath</a> property.<br/><br/>\n\nFor more sophisticated markup of speakable sections beyond simple ID references, either CSS selectors or XPath expressions to pick out document section(s) as speakable. For this\nwe define a supporting type, <a class=\"localLink\" href=\"http://schema.org/SpeakableSpecification\">SpeakableSpecification</a>  which is defined to be a possible value of the <em>speakable</em> property.'),(889,14,11,'containedIn','containedIn','The basic containment relation between a place and one that contains it.'),(890,14,11,'maxValue','maxValue','The upper value of some characteristic or property.'),(891,14,11,'seller','seller','An entity which offers (sells / leases / lends / loans) the services / goods.  A seller may also be a provider.'),(892,14,11,'endTime','endTime','The endTime of something. For a reserved event or service (e.g. FoodEstablishmentReservation), the time that it is expected to end. For actions that span a period of time, when the action was performed. e.g. John wrote a book from January to <em>December</em>. For media, including audio and video, it\'s the time offset of the end of a clip within a larger file.<br/><br/>\n\nNote that Event uses startDate/endDate instead of startTime/endTime, even when describing dates with times. This situation may be clarified in future revisions.'),(893,14,11,'amount','amount','The amount of money.'),(894,14,11,'serviceArea','serviceArea','The geographic area where the service is provided.'),(895,14,11,'isbn','isbn','The ISBN of the book.'),(896,14,11,'acceptedAnswer','acceptedAnswer','The answer(s) that has been accepted as best, typically on a Question/Answer site. Sites vary in their selection mechanisms, e.g. drawing on community opinion and/or the view of the Question author.'),(897,14,11,'genre','genre','Genre of the creative work, broadcast channel or group.'),(898,14,11,'hiringOrganization','hiringOrganization','Organization offering the job position.'),(899,14,11,'gtin8','gtin8','The <a href=\"http://apps.gs1.org/GDD/glossary/Pages/GTIN-8.aspx\">GTIN-8</a> code of the product, or the product to which the offer refers. This code is also known as EAN/