ums.'),(982,14,11,'customer','customer','Party placing the order or paying the invoice.'),(983,14,11,'percentile10','percentile10','The 10th percentile value.'),(984,14,11,'spatial','spatial','The \"spatial\" property can be used in cases when more specific properties\n(e.g. <a class=\"localLink\" href=\"http://schema.org/locationCreated\">locationCreated</a>, <a class=\"localLink\" href=\"http://schema.org/spatialCoverage\">spatialCoverage</a>, <a class=\"localLink\" href=\"http://schema.org/contentLocation\">contentLocation</a>) are not known to be appropriate.'),(985,14,11,'valueName','valueName','Indicates the name of the PropertyValueSpecification to be used in URL templates and form encoding in a manner analogous to HTML\'s input@name.'),(986,14,11,'downvoteCount','downvoteCount','The number of downvotes this question, answer or comment has received from the community.'),(987,14,11,'mapType','mapType','Indicates the kind of Map, from the MapCategoryType Enumeration.'),(988,14,11,'reviewBody','reviewBody','The actual body of the review.'),(989,14,11,'courseMode','courseMode','The medium or means of delivery of the course instance or the mode of study, either as a text label (e.g. \"online\", \"onsite\" or \"blended\"; \"synchronous\" or \"asynchronous\"; \"full-time\" or \"part-time\") or as a URL reference to a term from a controlled vocabulary (e.g. https://ceds.ed.gov/element/001311#Asynchronous ).'),(990,14,11,'audienceType','audienceType','The target group associated with a given audience (e.g. veterans, car owners, musicians, etc.).'),(991,14,11,'requiredMaxAge','requiredMaxAge','Audiences defined by a person\'s maximum age.'),(992,14,11,'minValue','minValue','The lower value of some characteristic or property.'),(993,14,11,'serviceType','serviceType','The type of service being offered, e.g. veterans\' benefits, emergency relief, etc.'),(994,14,11,'minimumPaymentDue','minimumPaymentDue','The minimum payment required at this time.'),(995,14,11,'addressRegi