ent applies.'),(1618,14,11,'numberOfSeasons','numberOfSeasons','The number of seasons in this series.'),(1619,14,11,'target','target','Indicates a target EntryPoint for an Action.'),(1620,14,11,'underName','underName','The person or organization the reservation or ticket is for.'),(1621,14,11,'accessibilityFeature','accessibilityFeature','Content features of the resource, such as accessible media, alternatives and supported enhancements for accessibility (<a href=\"http://www.w3.org/wiki/WebSchemas/Accessibility\">WebSchemas wiki lists possible values</a>).'),(1622,14,11,'text','text','The textual content of this CreativeWork.'),(1623,14,11,'givenName','givenName','Given name. In the U.S., the first name of a Person. This can be used along with familyName instead of the name property.'),(1624,14,11,'lodgingUnitType','lodgingUnitType','Textual description of the unit type (including suite vs. room, size of bed, etc.).'),(1625,14,11,'includedComposition','includedComposition','Smaller compositions included in this work (e.g. a movement in a symphony).'),(1626,14,11,'availableOnDevice','availableOnDevice','Device required to run the application. Used in cases where a specific make/model is required to run the application.'),(1627,14,11,'albumReleaseType','albumReleaseType','The kind of release which this album is: single, EP or album.'),(1628,14,11,'borrower','borrower','A sub property of participant. The person that borrows the object being lent.'),(1629,14,11,'founder','founder','A person who founded this organization.'),(1630,14,11,'targetProduct','targetProduct','Target Operating System / Product to which the code applies.  If applies to several versions, just the product name can be used.'),(1631,14,11,'map','map','A URL to a map of the place.'),(1632,14,11,'competitor','competitor','A competitor in a sports event.'),(1633,14,11,'events','events','Upcoming or past events associated with this place or organization.'),(1634,14,11,'significantLink','significantLink',