eat','ticketedSeat','The seat associated with the ticket.'),(1651,14,11,'softwareAddOn','softwareAddOn','Additional content for a software application.'),(1652,14,11,'interactionType','interactionType','The Action representing the type of interaction. For up votes, +1s, etc. use <a class=\"localLink\" href=\"http://schema.org/LikeAction\">LikeAction</a>. For down votes use <a class=\"localLink\" href=\"http://schema.org/DislikeAction\">DislikeAction</a>. Otherwise, use the most specific Action.'),(1653,14,11,'billingIncrement','billingIncrement','This property specifies the minimal quantity and rounding increment that will be the basis for the billing. The unit of measurement is specified by the unitCode property.'),(1654,14,11,'commentText','commentText','The text of the UserComment.'),(1655,14,11,'hasPart','hasPart','Indicates an item or CreativeWork that is part of this item, or CreativeWork (in some sense).'),(1656,14,11,'availableChannel','availableChannel','A means of accessing the service (e.g. a phone bank, a web site, a location, etc.).'),(1657,14,11,'paymentStatus','paymentStatus','The status of payment; whether the invoice has been paid or not.'),(1658,14,11,'merchant','merchant','\'merchant\' is an out-dated term for \'seller\'.'),(1659,14,11,'geoMidpoint','geoMidpoint','Indicates the GeoCoordinates at the centre of a GeoShape e.g. GeoCircle.'),(1660,14,11,'application','application','An application that can complete the request.'),(1661,14,11,'creditedTo','creditedTo','The group the release is credited to if different than the byArtist. For example, Red and Blue is credited to \"Stefani Germanotta Band\", but by Lady Gaga.'),(1662,14,11,'vehicleIdentificationNumber','vehicleIdentificationNumber','The Vehicle Identification Number (VIN) is a unique serial number used by the automotive industry to identify individual motor vehicles.'),(1663,14,11,'featureList','featureList','Features or modules provided by this application (and possibly required by other 