  CONSTRAINT "FK_C6F063AD7E3C61F9" FOREIGN KEY ("owner_id") REFERENCES "user" ("id") ON DELETE SET NULL,
  CONSTRAINT "FK_C6F063ADAD0E05F6" FOREIGN KEY ("vocabulary_id") REFERENCES "vocabulary" ("id")
);
