368,941,362,'resource:item',NULL,NULL,NULL,1),(3669,368,1,NULL,'literal',NULL,'(Inc. deuota oracio ven. Bonauenture ad S. trinitatem) (Emmanuel College, MS 241)',NULL,1),(3670,368,1097,NULL,'literal',NULL,'2',NULL,1),(3671,368,1292,NULL,'literal',NULL,'Latin',NULL,1),(3672,368,1744,NULL,'xsd:boolean',NULL,'0',NULL,1),(3673,368,1636,NULL,'literal',NULL,'f. 17b - Inc. deuota oracio ven. Bonauenture ad S. trinitatem\nf. 18 - In fide summe et indiuide trinitatis obsecro.\nInc. tabula meditacionum vite Ihesu Christi sec. Bonauenturam.\nf. 19 - Inc. prologus meditacionum vite Saluatoris nostri I. C.\nf. 20 - Inter alia virtutum et laudum -  et ideo de ipsis videamus.\nc. i. Cum per longissima tempora\nf. 20-86b - c. cxxi - De modo meditandi etc, subesse desingnauit. hec Bernardus. Et sic finitur liber. Deo gracias (bis). \nExpl. medit. quas composuit ven. Cardinalis Bonauentura, de vita passione et morte saluatoris nostri I. C. deo gracias.',NULL,1),(3674,369,941,362,'resource:item',NULL,NULL,NULL,1),(3675,369,1,NULL,'literal',NULL,'Life of St John the Apostle (Inc. vita S. Jacobi apostoli vocati fratris domini cum noua addicione) (Emmanuel College, MS 241)',NULL,1),(3676,369,1097,NULL,'literal',NULL,'3',NULL,1),(3677,369,1292,NULL,'literal',NULL,'Latin',NULL,1),(3678,369,1744,NULL,'xsd:boolean',NULL,'0',NULL,1),(3679,369,1636,NULL,'literal',NULL,'f. 86b - Inc. vita S. Jacobi apostoli vocati fratris domini cum noua addicione\nCogitaui ego quidem carthuensis monachus illo nomine indignus predicatur et rudis\nHe seems to take the text of the Legenda Aurea and expound it. \nEnds f. 103: Osanna in excelsis. Saluum fac in celis, quo nos perducat qui uiuit et regnat deus per omnia sec. sec. Amen. \nExpl. vita b. Jacobu ap. vocati fratris domini cum noua addicione, quam apposuit quidam monachus modicus et minutus sed miser magnus in domo Ihesu de betleeem iuxta scheme ad. 1474 tempore messis. Deo gracias. Aspice in me domine et miserere mei secundum iudicium diligencium nomen tuum. Amen.',NULL,1),(3680,370,941,362,'resource:item',NULL,NULL,NULL,1),(3681,370,1,NULL,'literal',NULL,'Biblical table of contents (Inc. tabula super Bibliam) (Emmanuel College, MS 241)',NULL,1),(3682,370,1097,NULL,'literal',NULL,'4',NULL,1),(3683,370,1292,NULL,'literal',NULL,'Latin',NULL,1),(3684,370,1744,NULL,'xsd:boolean',NULL,'0',NULL,1),(3685,370,1636,NULL,'literal',NULL,'f. 103b - Inc. tabula super Bibliam. Genesis i. Creauit deus celum et terram. \nAn epitome of each chapter of the Bible\nEnds f. 147 - qui apposuerit vel diminuerit de verbis prophecie libri huius etc. \nExpl. tabula super bibliam. Deo gracias. \nf. 107 - A table of subjects',NULL,1),(3686,370,1760,NULL,'literal',NULL,'f. 86b-147',NULL,1),(3687,362,1722,NULL,'xsd:boolean',NULL,'0',NULL,0),(3688,362,1636,NULL,'literal',NULL,'Catalogue entry provided by Emmanuel College',NULL,1),(3689,362,1739,NULL,'literal',NULL,'Parchment (and paper)',NULL,1),(3690,362,1760,NULL,'literal',NULL,'155',NULL,1),(3692,362,1723,NULL,'literal',NULL,'1^8 (2-7 paper) 2^8 (2-7 paper) 3^10 4^8-14^8 15^10-19^8 (7 stuck to cover: wants 8)',NULL,1),(3693,362,4,NULL,'literal',NULL,'From Carthusians of Sheen',NULL,1),(3694,335,1636,NULL,'literal',NULL,'From online catalogue: Saint Bridget,; of Sweden: \"Extracta de libris Revelationum Dei Beate Birgitte\": 15th cent.\n\nNo other information',NULL,1),(3695,371,1490,NULL,'valuesuggest:oclc:viaf',NULL,'Mechtilde de Hackeborn, 1241-1299, sainte','http://www.viaf.org/viaf/78750420',1),(3696,371,854,NULL,'xsd:date',NULL,'1298-11-19',NULL,1),(3697,371,1721,NULL,'xsd:boolean',NULL,'0',NULL,0),(3698,371,1724,NULL,'xsd:boolean',NULL,'0',NULL,0),(3699,372,886,371,'resource:item',NULL,NULL,NULL,1),(3700,372,1,NULL,'literal',NULL,'Liber spiritualis gratiae',NULL,1),(3701,372,1292,NULL,'literal',NULL,'Latin',NULL,1),(3702,372,1744,NULL,'xsd:boolean',NULL,'0',NULL,1),(3703,336,1760,NULL,'literal',NULL,'54-60b',NULL,1),(3704,373,1490,NULL,'valuesuggest:oclc:viaf',NULL,'John the Apostle, apos