efore it was united with the 17th century manuscript. Beginning of Vita Beate Marie is lost, but the ancient numbering continues\n\nPezzini (1992) \n- Vitae Beate Marie (ff. 1r-43v)\n- the second, which is given for convenience the title of Wordis of\nChrist to hys spowse, includes chapters 3, 4, and 5 (incomplete) (ff. 44r-52r).',NULL,1),(3787,258,1636,NULL,'literal',NULL,'Quarto Catalogue, col. 12:\n\"The life and death of Mary Magdalene, or, her life in sin, and death to sin\" By Th. Robinson; dedicated to W. Taylour, B. D., fellow of Trinity College, his former tutor. fol 53.\nIn two parts; the first containing 107 stanzas, and the second 92, of eight lines each. At the end are added 24 Latin verses, \"De Christo cum Simone prandente et Mariam Magdalenam comiter excipiente.\"',NULL,1),(3788,258,1739,NULL,'literal',NULL,'Paper',NULL,1),(3789,218,1760,NULL,'literal',NULL,'91',NULL,1),(3790,218,1480,NULL,'uri',NULL,'Online catalogue entry','https://medieval.bodleian.ox.ac.uk/catalog/manuscript_8208',1),(3791,257,1739,NULL,'literal',NULL,'Paper',NULL,1),(3793,218,4,NULL,'literal',NULL,'Quarto Catalogue, col. 12: On a fly-leaf at the beginning of the first tract is the name of \"Antho. Copley, 7 Sept. 1599.\" On the cover of the volume is pasted a short description of its contents by Edw. Umfreville.',NULL,1),(3794,257,1731,NULL,'literal',NULL,'1',NULL,1),(3795,321,1725,NULL,'literal',NULL,'Miniatures (partly defaced), borders (some unfinished), and initials',NULL,1),(3796,321,1744,NULL,'xsd:boolean',NULL,'0',NULL,1),(3797,321,1636,NULL,'literal',NULL,'Produced in France, Flanders and England. \n\nInterpreted by Scott as a Franco-Flemish Book of Hours enhanced in England with additional text and decoration',NULL,1),(3798,321,1739,NULL,'literal',NULL,'Parchment',NULL,1),(3799,321,1731,NULL,'literal',NULL,'1',NULL,1),(3800,321,1733,NULL,'literal',NULL,'23',NULL,1),(3801,321,1760,NULL,'literal',NULL,'2r-123v; 140r-147v',NULL,1),(3802,320,1636,NULL,'literal',NULL,'Catalo