,1743,NULL,'literal',NULL,'Ayto and Barratt (1984)\nConnolly (1994)\nPezzini (1988)',NULL,1),(4422,454,1722,NULL,'xsd:boolean',NULL,'0',NULL,0),(4423,454,1636,NULL,'literal',NULL,'Connolly (1994): The first five items, none of which is complete, form a collection of meditative material which is given the general heading \'Fervor Amoris\'. This heading is used elsewhere as a title for the text more familiarly known as Contemplations ofthe Dread and Love of God, the seventh item in Arundel 197.* The appearance of this heading at the top off. 1r is interesting, and must be either a mistake on the part of the scribe, or, as seems more likely, given the sequence and nature of these short texts, evidence of an attempt to compose a new work altogether, possibly re-writing Contemplations in the process. Redrafting is a characteristic of the manuscript as a whole. What is curious about this otherwise unremarkable collection of devotional pieces is that the text of each work has been subjected to extensive revision, with lengthy additions and omissions, and many corrections to individual words and phrases. The result is that the texts within Arundel 197 differ significantly from their other witnesses elsewhere.',NULL,1),(4424,454,1739,NULL,'literal',NULL,'Parchment',NULL,1),(4425,454,1727,NULL,'literal',NULL,'192 x 132 mm',NULL,1),(4426,454,1760,NULL,'literal',NULL,'73',NULL,1),(4427,465,1744,NULL,'xsd:boolean',NULL,'0',NULL,1),(4428,454,1480,NULL,'uri',NULL,'Connolly (1994) - manuscript description','https://www.bl.uk/eblj/1994articles/pdf/article4.pdf',1),(4429,454,4,NULL,'literal',NULL,'Very plain, without decoration',NULL,1),(4430,458,1760,NULL,'literal',NULL,'ff. 3v-6v',NULL,1),(4431,466,1760,NULL,'literal',NULL,'ff. 10r-38v',NULL,1),(4432,464,1760,NULL,'literal',NULL,'f. 10r',NULL,1),(4433,467,1760,NULL,'literal',NULL,'ff. 38v-47v\ni) 38v-45r: Revelations 6.65\nii) 45r-46v: Revelations 2.65\niii) 46v-47v: Revelations 2.16',NULL,1),(4434,473,1490,NULL,'valuesuggest:oclc: